window.bookSummaryJSON = "<p>Lucy thinks the huge Monstrum warrior, T’zaren is a grumpy stick-in-the-mud.</p> <p>T’zaren disapproves of the curvy little human female’s light-hearted view of life.</p> <p>But when they have to go on a mission together as Lady and manservant and T’zaren had to serve her in some extremely intimate ways, will they change their minds? And will T’zaren ever succeed in…Finding his Goddess? To find out you’ll have to listen to this Enemies to Lovers, Grump and Sunshine, Fake Dating, Hot Alien Warrior Romance!<br> <br> Is there anything worse than a grumpy man? What about a grumpy seven-foot-tall Monstrum warrior who seems to have no sense of humor at all? Lucy Heartwood doesn’t think so. She’s an optimist at heart with a bubbly personality and she’s not anxious to spend extended time with a stick-in-the-mud like T’zaren.<br> <br> Unfortunately, the huge Monstrum is going to be her protector on a mission to save the Monstrum Mother Ship. They must travel together to the stronghold of Lady Twi’linda—a Twainer who has the only supply of dimriel crystals, which the Mother Ship desperately needs.<br> <br> T’zaren doesn’t approve of Lucille—she’s not serious enough. But she makes the Sen Stripe along his spine flare like no other woman ever has, making her damn hard to resist. When he has to act like her manservant and “serve” her in every way on their mission, their strained relationship suddenly gets a lot more interesting. But when their hostess takes a turn towards evil and danger stalks them both, will he be able to save her?</p> <p>And will he ever succeed in…Finding his Goddess?</p>"; 
